import React from "react";
import "./Expense.css";
import ExpenseDate from "./ExpenseDate";

const Expense = (props) => {
  return (
    <div className="expense">
      <ExpenseDate date={props.date} />
      <div className="epxense-des">
        <h1>Title</h1>
        <h2>Price</h2>
      </div>
    </div>
  );
};

export default Expense;
